    "All groups must have a unique name.": "\u00c0ll gr\u00f6\u00fcps m\u00fcst h\u00e4v\u00e9 \u00e4 \u00fcn\u00efq\u00fc\u00e9 n\u00e4m\u00e9. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442#", 
    "All learners in the {cohort_name} cohort": "\u00c0ll l\u00e9\u00e4rn\u00e9rs \u00efn th\u00e9 {cohort_name} \u00e7\u00f6h\u00f6rt \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442#", 
