    "Toggle Notifications Setting": "T\u00f6ggl\u00e9 N\u00f6t\u00eff\u00ef\u00e7\u00e4t\u00ef\u00f6ns S\u00e9tt\u00efng \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2#", 
    "Tools": "T\u00f6\u00f6ls \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455#", 
    "Top": "T\u00f6p \u2c60'\u03c3\u044f\u0454\u043c#", 
    "Topic": "T\u00f6p\u00ef\u00e7 \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455#", 
